Налог на профессиональный доход – это специальный налоговый режим для физических лиц, который вводится с 1 января 2023 года.
Приложение «Налог на профессиональный доход» — это официальное приложение Министерства по налогам и сборам для плательщиков налога на профессиональный доход. Приложение обеспечивает дистанционный способ взаимодействия физического лица и налогового органа.
С помощью приложения можно получить ряд налоговых услуг: 
•	постановка на учет в налоговом органе физического лица в качестве плательщика налога на профессиональный доход;
•	снятия физического лица с учета в налоговых органах в качестве плательщика налога на профессиональный доход;
•	передачи в налоговый орган сведений о расчетах при применении налога на профессиональный доход;
•	формирования записей (чеков) о совершаемых расчетах;
•	корректировки ранее переданных налоговому органу сведений о расчетах;
•	уплаты сумм налога при применении налога на профессиональный доход.
Пользователю нет необходимости подавать отчет – приложение само ведет учёт доходов и рассчитывает налог, формирует электронные чеки.
